                    setSelection={setSelection}
                />
            </li>
            <li>
                <RatingInput
                    num={10}
                    selection={selection}
                    setRating={setRating}
                    setSelection={setSelection}
                />
            </li>
        </ul>
    );
};

export default RatingGroup;
